import React from 'react';
import tachyons from 'tachyons';

const FaceRecognition = ({url}) => {
	return(
		<div className='w-60 mt5 shadow-2 br2 pa5 center'>
			{url}
			<img src={url} alt='image'/>
			}
		</div>
	)
}
export default FaceRecognition;
